import React from "react";
import "./Main.css";
import { Button, Form } from "react-bootstrap";

const Home = () => {
  return (
    <div className="Home">
      <div className="lol">
        <Form className="d-flex">
          <Form.Control
            type="search"
            placeholder="Search"
            className="me-2"
            aria-label="Search"
            style={{ width: "230px" }}
          />
          <Button variant="danger">Search</Button>
        </Form>
      </div>
    </div>
  );
};

export default Home;
